script: |
  super -f text -I q4923.spq | sort > q4923.out

inputs:
  - name: q4923.spq
    data: |
      SELECT + - 17 * - col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + col0 * + ( + col1 ) + - col0 * col0 IS NULL;
  - name: tab0

outputs:
  - name: q4923.out
    data: |
      1377
      17
      357
